import React from 'react';
import { Card } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faInfoCircle, faFileAlt, faCode, faWindowRestore, faPlay } from '@fortawesome/free-solid-svg-icons';

function Showcase() {
  return (
    <div className="">
      <Card style={{width: "18rem"}}>
        <Card.Img variant="top" src={require('./img/me.png').default} />
        <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the bulk of the card's content.
            <div className="venue-info">Venue</div>
          </Card.Text>
          {/*<Button variant="primary">Go somewhere</Button>*/}
          <Card.Link className="showcase-link" href="#"><FontAwesomeIcon icon={faCode} /> Link
          </Card.Link>
        </Card.Body>
      </Card>

    </div>
  );
}

export default Showcase;
